def lengthOfLongestSubstring(s):
    """
    :type s: str
    :rtype: int
    """
    length = len(s)
    ret = ''
    for i in s:
        ret += i if i not in ret else ''
    length = len(ret)

    for l in range(length, 1, -1):
        for j in range(0, len(s) - l + 1):
            subString = s[j:j + l]
            for char in subString:
                res = subString.replace(char, '', 1)
                if char in res:
                    break
                else:
                    continue
            else:
                return l, subString


