def fun(s):
    st = {}
    i, ans = 0, 0
    for j in range(len(s)):
        if s[j] in st:
            i = max(st[s[j]], i)
        st[s[j]] = j + 1
        ans = max(ans, j - i + 1)
    return ans, i, len(st)


