def convert(s, numRows):
    """
    :type s: str
    :type numRows: int
    :rtype: str
    """
    length = len(s)
    chars = ['' for i in range(numRows)]
    c = 0
    d = -1
    for i in range(length):
        chars[c] += s[i]
        if c % (numRows - 1) == 0:
            d *= -1
        c += d
    return ''.join(chars)


