def happyNum(num):

    ret = 0
    for n in getDi(num):
        ret += n ** 2
    if ret == 1:
        return True
    try:
        return happyNum(ret)
    except:
        return False



def getDi(num):
    res = []
    while num >= 10:
        ret = num % 10
        res.append(ret)
        num = num // 10
        if num < 10:
            res.append(num)
    return res


