class Solution:
    def myAtoi(self, str):
        """
        :type str: str
        :rtype: int
        """
        s = str.strip()
        import re_
        ret = re_.match(r'^([-+0-9]\d*).*', s)
        if not ret:
            return 0

        ret = ret.group(1)
        if ret == '-' or ret == '+':
            return 0
        ret = int(ret)
        if -2 ** 31 <= ret <= (2 ** 31 - 1):
            return ret
        elif -2 ** 31 > ret:
            return -2 ** 31
        else:
            return 2 ** 31 - 1
